import Driver from "./components/Driver";
import { Routes, Route, BrowserRouter, Link } from "react-router-dom";

function App() {
  const padding = {
    padding: 5
  }

  return (
    <>
    <BrowserRouter>
    <Routes>
        {/* <Route path="/notes" element={<Notes />} /> */}
        <Route path="/users" element={"yolo"} />
        <Route path="/" element={<Driver />} />
    </Routes>
    </BrowserRouter>
    </>
  );
}

export default App;
